INSERT INTO `tulisan` (`id`, `judul`, `tipe_konten`, `penulis`, `konten`, `id_buletin`) VALUES
(28, 'Bisa Karena Biasa', '1-telaah-utama', 'Siti Nurohmah', 'Hawa nafsu adalah asal dari jihad melawan orang kafir dan orang munafik. Kita tidak mampu berjihad melawan orang kafir dan munafik sampai berjihad terlebih dahulu melawan diri sendiri. Hawa nafsu lebih pertama diperangi lalu keluar jihad melawan mereka. (Disebutkan dalam Roudhotul Muhibbin, karya Ibnul Qayyim, terbitan Ibnu Katsir, cetakan ketiga, tahun 1429 H, halaman 530.)\r\n \r\nPerang  melawan  nafsu  sesungguhnya tidak pernah berhenti kita lakukan. Hampir setiap keadaan, manusia sebetulnya selalu dihadapkan dengan situasi perang, yaitu perang melawan musuh abadi manusia. Siapakah itu? Yakni nafsu negatif yang tak terlihat, tapi selalu ada dalam diri kita masing-masing.\r\n \r\nSemua penyakit hati dan kebiasaan (habits) yang buruk bersumber dari nafsu. Dan salah satu cara untuk keluar darinya yaitu dengan kembali membentuk habits yang baik.\r\n \r\nJadi sobat hikam, habits (kebiasaan) adalah segala sesuatu yang kita lakukan secara otomatis, bahkan kita melakukannya tanpa berfikir. Habits dilakukan secara terus menerus sehingga menjadi bagian daripada seorang manusia, dia adalah kebiasaan kita.\r\n \r\nDalam proses pembentukan  habits, peran akal tidaklah terlalu dominan.  Faktor yang menentukan seseorang memiliki habits  hanya dua hal, yaitu practice (latihan) yang berfungsi untuk menentukan perilaku yang dilakukan sudah benar atau belum dan repetition (pengulangan) yang berfungsi untuk menyempurnakan latihan. Practice makes right, repetition makes perfect. \r\n\r\nRasulullah  juga berpesan kepada kita bahwa amal yang disukai Allah bukan dari segi banyaknya saja. Namun amal yang dilakukan secara terus menerus dan konsisten. Sesungguhnya amalan yang disukai Allah yaitu yang dikerjakan terusmenerus. (Hadis Riwayat Bukhari Muslim).\r\n \r\nAda tiga langkah praktis dan  mudah yang perlu kita lakukan untuk membentuk habits baru. Sobat hikam memerlukan alat tulis dan kertas. Spidol dan kertas yang agak besar lebih baik karena lebih terlihat.\r\n  \r\nYang pertama yaitu mulai dari yang kecil. Mulailah habits baru kita dengan hal kecil terlebih dahulu. Mematok target yang terlalu tinggi hanya akan menghasilkan rasa jenuh dan putus asa di tengah-tengah. Misalnya mulailah dengan 10 menit sehari membaca buku, atau 10 lembar per  hari  membaca  buku. Mematok target besar cenderung gagal, apabila telah terbiasa kita  akan  menaikkan jumlahnya secara otomatis.\r\n \r\nYang kedua yaitu temukan tempat habits. Kita harus menyisipkan habits itu pada habits lain yang sudah solid (jadi). Kuncinya adalah kata setelah. Misalnya saya akan membaca Al-Qur\'an setelah shalat subuh, dan sebagainya.\r\n \r\nYang ketiga adalah berlatih  terus! Pada awalnya, mungkin kita akan sering kali lupa untuk melaksankan habits baru, maka buatlah pengingat dimana-mana (tempat biasa kita beraktivitas) yang berfungsi sebagai reminder, atau bisa meminta teman untuk selalu mengingatkan tentang habits yang akan kita latih. Dan ingat untuk melakukan setiap hari!\r\n \r\nSobat hikam, tentu kita  mengetahui bahwa hal yang paling sulit dilakukan adalah action, amal nyata. Seringkali kita tidak sadar, bahwa kita telah membentuk kebiasaan menundanunda amal. Talk is Cheap, but Action is Priceless. Berbicara itu murah, namun amal perbuatan tak ternilai harganya. Inilah tujuan dari habits, menyampaikan bahwa Action speaks Louder than Motivation speaks. Bahwa lebih penting beramal daripada hanya  termotivasi, syukur-syukur kita bisa termotivasi lalu beramal, aamiin.\r\n \r\nKembali ke pembahasan di awal bahwa yang perlu diwaspadai dan diperangi adalah diri kita sendiri. Apabila kita ingin membentuk habits menjauhkan diri dari maksiat, penyakit hati, dan kebiasaan buruk. Maka camkan bahwa tidak ada kata Ini yang terakhir deh, karena jika terdapat kata seperti itu berarti akan ada penyakit hati dan kebiasaan buruk lagi yang akan dilakukan.\r\n \r\nItulah nafsu yang harus  diperangi dalam diri kita. Bila kita ingin membentuk habits, maka kita harus lebih waspada terhadapnya. Keras kepada diri sendiri dalam pembentukan habits itu penting. Disiplin dan memaksa diri melakukan apa yang tak suka kita lakukan seringkali jadi hal yang penting.\r\n\r\n\"Jika kalian berbuat baik, kalian telah berbuat baik untuk diri kalian sendiri. dan kalau kalian berbuat jahat, maka kalian juga telah berbuat jahat untuk kalian sendiri.\r\n(Q.S. Al-Isra [17]: 7)\r\n\r\nSumber:\r\nSiauw, Felix Y. 2017. How To Master Your Habits. Jakarta: Al Fatih Press.', 1),
(30, 'Always be Positive', '3-akhlak', 'Fadriatul Khoiriyah', '              \r\n\r\n\"Wahai orang-orang yang beriman! Jauhilah banyak dari purba-sangka, sesungguhnya sebagian dari purba-sangka itu dosa.\"\r\n(Q.S. Al-Hujurat [49]: 12)\r\n\r\nSetelah membaca ayat tersebut, Kita pasti sudah tahu bahwa purbasangka atau su\'udzan di dalam firman-Nya merupakan perbuatan yang dilarang oleh Allah SWT. Sobat Hikam, ternyata su\'udzan merupakan salah satu penyakit hati yang cukup berbahaya. Seseorang yang menderita penyakit su\'udzan, akan selalu merasa curiga pada orang lain, suka menghina,  mengolok-olok,  menggunjing dan mencari-cari keburukan orang lain.\r\n\r\nSobat Hikam, tidak ada penyakit yang tak bisa disembuhkan, maka demikian pula dengan penyakit hati yang satu ini. Su\'udzan  dapat disembuhkan dengan selalu berpikir positif atau dengan mengamalkan lawan dari sikap su\'udzan, yaitu husnudzan. Husnudzan sendiri berasal dari bahasa arab yaitu husnu yang berarti baik, dan azannu yang berarti prasangka. Dengan demikian husnudzan dapat diartikan sebagai prasangka atau dugaan baik.\r\n\r\nSobat Hikam, suatu penyakit akan sulit sembuh apabila obat yang diminum tidak sesuai dengan dosis yang disarankan. Begitu pula dengan su\'udzan, untuk mengobatinya kita bukan hanya harus mengamalkan husnudzan kepada orang lain saja, namun juga kepada Allah dan diri sendiri. Kita harus selalu yakin bahwa di balik derita yang kita terima, selalu ada hikmah yang begitu besarnya. \r\n\r\nLain halnya dengan husnudzan kepada diri sendiri yang dapat diaplikasikan dengan sikap percaya diri, inisiatif, dan pantang menyerah dalam melakukan suatu hal. Di samping itu, sikap husnudzan yang tak kalah pentingnya adalah berbaik sangka atau percaya kepada orang lain. Mempercayai orang lain itu penting dan bermanfaat bagi diri sendiri serta orang lain. \r\n\r\nSobat Hikam yang dirahmati Allah SWT, marilah kita berusaha untuk selalu memperbaiki diri dengan  berpikir positif. Yakinlah, bahwa setiap kejadian pasti ada alasannya, bahwa setiap derita pasti ada hikmah dibaliknya. \r\n\r\nSumber:\r\nKhalid, Amru. 2008.Buku Tampil Menawan dengan Akhlak Mulia. Jakarta: Cakrawala  ', 1),
(31, 'Sang Penakluk Konstantinopel', '8-tarikh', '\'Aeni Zahro', 'Muhammad Al-Fatih adalah sultan ketujuh dalam sejarah Bani Utsmani. Ia adalah sultan yang jenius dalam hal administrasi, apalagi dalam hal peperangan. Muhammad Al-Fatih lahir di Edirne pada 28 Maret 1432 (menurut sumber-sumber berbahasa arab lain, ia lahir pada 26 Rajab 833 H atau bertepatan dengan 20 April 1430). Ayahnya adalah Murad II yang merupakan sultan keenam Bani Utsmani.\r\n \r\nPada usia 6 tahun Muhammad II (Muhammad Al-Fatih) dididik secarakhusus guna mempersiapkannya menjadi pengganti ayahnya. Syaikh Ahmad AlKurani dan Syaikh Aaq Syamsuddinadalah syaikh yang ditugaskan untuk menjadi guru Muhammad II. Syeikh Syamsuddin yang menyadarkan Muhammad bahwa dirinyalah pemimpin yang dimaksud dalam hadits Rasulullah yang diriwayatkan Ahmad, Pasti, akan ditaklukkan Konstantinopel dan sebaik-baik pemimpin adalah pemimpinnya dan sebaik-baik pasukan adalah pasukannya.\r\n \r\nMuhammad memegang kendali penuh pada pemerintahan Utsmani setelah ayahnya wafat ketika berumur 19 tahun di tahun 1451. Program besar yang langsung ia canangkan ketika menjabat sebagai khalifah adalah menaklukkan Konstantinopel.\r\n \r\nDengan keyakinan pada perkataan Rasulullah bahwa Konstantinopel pasti akan takluk dibawah pemimpin terbaik dan keinginan kuatnya untuk menjadi pemimpin itu telah menjadikan Sultan Muhammad II memiliki mental seorang penakluk agung, yaitu melihat dengan akal bukan dengan matanya.\r\n \r\nHingga pada tanggal 20 Jumadil Awal 857 H dan bertepatan pada hari Selasa 29 Mei 1453, ketika itu umurnya baru 21 tahun lebih 2 bulan, Sultan Muhammad bersama pasukan muslimnya berhasil menaklukan Kota Konstantinopel. Sejak saat itulah ia mendapat gelar sebagai Al-Fatih, penakluk Konstantinopel.\r\n\r\nMuhammad Al-Fatih menutup usianya dalam kondisi bersiap untuk membebaskan Roma pada 3 Mei 1481 dalam usia 49 tahun. Kala itu, Sultan Muhammad II tidak merasa seperti biasanya. Penyakit radang sendi yang dideritanya sejak tahun 1470 bertambah parah. Pasukan yang paling istimewa telah disiapkan untuk menaklukkan Roma. Tetapi Allah berkehendak lain.\r\n\r\nSumber:\r\nSiauw, Felix Y. 2013. Muhammad Al-Fatih 1453. Jakarta: Alfatih Press.', 1),
(32, 'Hati-hati dengan Diri', '6-tafakur', 'Ardina Dewi R.A.', 'Sobat Hikam, pasti kalian pernah mendapatkan godaan bahkan sering. Apa sih sebenarnya godaan itu? Menurut Kamus Besar Bahasa Indonesia, godaan adalah segala sesuatu yang dapat menggoda ketabahan hati kita atau segala sesuatu yang mengganggu kita. Godaan sering dipandang sebagai pengaruh yang buruk bagi kita padahal tidak semua godaan itu negatif. Contohnya ketika kita bersosialisasi kepada siswa-siswi baru dalam rangka untuk menambah anggota sebuah organisasi. Pasti ada  siswa yang tergoda untuk bergabung ke dalam organisasi tersebut.\r\n \r\nSetiap orang akan mengalami futur, karena iman itu naik turun. Namun, jika hati kita begitu rentan terhadap godaan setan, hawa nafsu, terlalu cinta dengan dunia, ghibah atau bahkan godaan yang paling lemah sekalipun, maka itu berarti kita tidak dijaga oleh Allah SWT. Dan kita pun tidak atau kurang menjaga Allah. Itulah faktor mengapa kita rentan terhadap godaan. \r\n\r\nLalu apakah godaan itu datang hanya dari diri sendiri? Selain dari diri sendiri, godaan juga dapat berasal dari orang lain. Contohnya ketika kita sedang berpuasa lalu melihat teman kita sedang makan, hal itu bisa membuat kita tergoda untuk ikut makan. Tapi, apakah ada cara untuk menghindarkan diri dari godaan? Tentu saja ada, untuk lebih jelasnya mari kita ulas.\r\n \r\nSalah satu cara menghindarkan diri dari godaan adalah selalu mengingat Allah SWT dengan memperbanyak zikir. Sehingga kita bisa mengendalikan diri dari godaan buruk karena kita selalu ingat bahwa Allah selalu mengawasi setiap perbuatan yang kita lakukan. Selain itu tidak tergesa-gesa dan berhatihati dalam melakukan segala urusan juga dapat menghindarkan diri kita dari godaan. Kemudian, kita juga bisa  menyibukkan diri dengan hal-hal positif yang dapat mengontrol emosional kita. Dengan begitu kita senantiasa dilindungi oleh Allah SWT agar terhindar dari godaan diri sendiri, orang lain, maupun setan yang terkutuk yang dapat menjerumuskan kita ke dalam perbuatan yang dilarang oleh Allah SWT.\r\n\r\nSumber:\r\nGymnastiar, Abduallah. 2003. Mengatasi Penyakit Hati. Jakarta Selatan: Replubika', 1),
(33, 'Retno Herwanti: Tunaikan Kewajiban, Tuaikan Kesuksesan', '2-profil', 'Zuhdi Ali Hisyam', 'Sobat Hikam, siapa yang tidak kenal Bu Retno? Guru kelahiran 26 April 1974 ini adalah salah satu guru yang mengampu pelajaran Metematika Dasar di SMAN 1 Wonosobo. \r\n\r\nMenjadi seorang guru adalah impian Bu Retno sejak kecil. Dalam pandangan beliau, guru adalah sosok yang ikhlas, tenang, dan bahagia hidupnya. Atas izin Allah SWT, setelah Bu Retno tamat SMA bisa melanjutkan kuliah Sl di IKIP Semarang jurusan matematika lewat jalur PMDK (sekarang SNMPTN). Hal ini merupakan langkah awal Bu Retno untuk mewujudkan apa yang menjadi impiannya sejak kecil. Beliau melanjutkan S2-nya di UNNES Semarang. Dengan begitu, lengkap sudah gelar Magister pendidikannya.\r\n\r\nKetika lulus Sl tahun 1997, beliau mengikuti tes CPNS guru. Setelah diterima, beliau ditempatkan di SMP 2 Kejajar sejak Februari 1998 yang kemudian pernah meraih prestasi Juara 3 Guru Berprestasi, dan pada Oktober 2010 dipindahtugaskan ke SMAN 1 Wonosobo hingga sekarang. \"Saya sangat bahagia menjadi seorang guru, apalagi di SMAN 1 Wonosobo anak-anaknya cerdas\", ungkap alumnus SMA 1 Mojotengah ini. Allah telah mengabulkan impiannya. \r\n\r\nSelain mengampu pelajaran Matematika Dasar di SMAN 1 Wonosobo, ibu dari 3 anak ini juga sangat aktif mengikuti kegiatan kepramukaan baik di dalam sekolah maupun di luar sekolah. Beberapa pencapaian-pun diraih Oleh beliau, misalnya menjadi Juara 3 Pembina Pramuka Berprestasi tingkat Provinsi Jawa Tengah tahun 2017, dan Saat ini tercatat sebagai Instruktur Pramuka Nasional. \r\n\r\nKegigihan, kerja Keras, dan tanggungjawabnya dalam bidang kepramukaan patut diteladani generasi muda agar selalu bekerja keras dan bertanggungjawab ketika mendapatkan suatu amanah tertentu. Bagi saya, pramuka adalah suatu organisasi/wadah untuk pembentukan karakter generasi muda. Oleh karena itu, saya bangga bisa bergabung dalam organisasi Pramuka, karena saya bisa ikut andil dalam membentuk karakter generasi muda\", jelasnya. \r\n\r\nDalam setiap pencapaiannya, istri dari Suhartono, SE. ini yakin bahwa itu semua berkat izin Allah yang disertai dengan kerja keras. Oleh karena itu, sudah sepatutnya bagi generasi muda untuk membuang jauh-jauh rasa malas dan selalu bekerja keras untuk menggapai apa yang menjadi impiannya, karena Allah Maha Membalas setiap usaha yang dilakukan makhluknya. \r\n\r\nDi tengah-tengah kesibukannya, Bu Retno selalu berusaha untuk menunaikan apa yang menjadi kewajibannya kepada Allah SWT. la memegang teguh prinsip bahwa untuk menjadi sukses saiah satunya adalah dengan menunaikan hak Allah sebaik-baiknya, dan jangan pernah meninggalkan Salat, selain juga disertai dengan kerja keras dan berdoa. \r\n\r\nSesibuk apapun kita di dunia ini, telah menjadi kewajiban kita untuk terus beribdah kepada Allah sebagai refleksi dari mahluk Allah yang lemah dan butuh pertolongan-Nya.\r\n\r\nBerikutnya, Bu Rtno berpesan untu para pelajar, \"Belajarlah untuk menjadi orang yang berkarakter dengan cara selalu tunaikan kewajiban pada Allah, sering-seringlah membaca Al-Qur\'an dengan menyediakan waktu khusus. Insyaallah hati kita jadi lembut dan urusan kita akan dimudahkan. \" \r\n\r\nSobat Hikam, marilah kita bekerja keras untuk menggapai apa yang kita impikan. Lengkapi dengan beribadah kepada Allah dan terus berdoa, niscaya Allah akan memudahkan kita dalam menggapai impian tersebut.\r\n\r\n\"Bersemangatlah melakukan hal yang bermanfaat untukmu dan meminta tolonglah pada Allah, serta janganlah engkau malas\".\r\n(H.R. Muslim)', 4),
(39, 'Coba Tulisan 1', '1-telaah-utama', 'Coba Tulisan 1', 'Coba Tulisan 1\r\nCoba Tulisan 1', 7),
(40, 'Al-Qur\'an and Science', '1-telaah-utama', 'Handika Yoga Pratama', 'llmu pengetahuan kini telah berkembang dengan pesat dan tidak dapat dipungkiri adanya. Hampir setiap hari terdapat penemuan baru yang cukup mengejutkan. Segala seluk beluk kehidupan dihubung-hubungkan dengan segala hal terkecuali agama. Sehingga sains kini sudah menjadi kebutuhan yang amat penting bagi manusia. \r\n\r\nLalu bagaimana dengan Al-Quran? Apakah isinya relevan dengan sains? Jelas sekali bahwa isi kandungan Al-Quran relevan dengan sains karena Al-Quran merupakan kitab yang diturunkan Allah kepada Nabi Muhammad sebagai pedoman umat manusia hingga hari akhir nanti. Allah beifirman dalam Al-Quran yang artinya \"Dan tidaklah yang diucapkanya itu (Al-Quran) menurut keinginanya. Tidak lain (Al-Quran itu) adalah wahyu yang diwahyukan kepadanya\" (Q.s. An-Najm [53]:3-4).\r\n\r\nKetika ilmu pengetahuan dn teknologi berkembang pesat seperti sekarang. Banyak orang-orang berlomba-lomba menggunakan akalnya dalam memahami segala penemuan-penemuan baru. Di Sisi lain para ilmuan Islam meneliti Al-Quran dan Hadist untuk menguak misteri yang ada di dalamnya.\r\n\r\nHingga kini satu persatu ayat dan hadist menunjukan keajaibanya. Banyak hal yang ditemukan ilmuan baru-baru ini ternyata telah disebutkan di dalam Al-Quran dan Hadist 1400 tahun yang lalu. Berikut ini kita akan membahas beberapa ayat dalam Al-Quran yang merujuk ke beberapa ilmu Sains modern. \r\n\r\n1. Astronomi \r\nDari teori yang telah disebutkan ilmuan asfrofisika, alam semesta pada awalnya berbentuk satu massa yang besar (Nebula Primer) kemudian terjadi \"Big bang\" (ledakan Pemisah sekunder) yang mengakibatkan pembentukan galaksi. Namun sebelum galaksi terbentuk, semua berbentuk gas atau awan. Hal ini telah disebutkan dalam Al-Quran beribu-ribu tahun yang lalu.\r\n\r\n\"Dan apakah orang-orang kafir tidak mengetahui bahwa langit dan bumi dahulu menyatu, kemudian kami pisahkan antara keduanya. Dan Kami jadikan segala sesuatu yang hidup berasal dari air. Maka mereka tidak juga beriman? \" (Q.S. Al-Anbiya [21]: 30).\r\n\r\nAl-Quran dalam mendeskripsikan materi atau awan mengguhkan kata dukhan yang berarti asap. \r\n\r\n2. Geografi \r\nDulu masyarakat percaya bahwa bumi itu datar, orang-orang tak berani berpetualang jauh karena takut jatuh ke tepi bumi. Sir Francis Drake mengatakan bahwa burni itu bulat setelah ia mengeliling bumi pada tahun 1597. Berkenaan dengan hal ini Al-Quran telah menerangkanya dengan tanda pergantian siang dan malam. \r\n\r\n\"Tidakkah engkau memperhatikan, bahwa Allah memasukan malam ke dalam siang dan memasukan siang ke dalam malam Dan dia menundukan matahari dan bulan masing-masing beredar sampai kepada waktu yang ditentukan. Sungguh, Allah Maha Teliti apa yang kamu kerjakan (Q.S. Luqman [31]: 29).\r\n\r\nKata \"memasukan\" di sini berarti bahwa berlaku secara perlahan dan bertahap, malam berganti menjadi siang dan sebaliknya. Fenomena ini hanya berlaku jika bumi berbentuk bulat. Bumi itu tidak persis seperti bola melaihkan berbentuk geospeherical yaitu sedikit rata di ujungnya. Sebagai orang islam yang beriman, kita harus mencari ilmu sebanyak-banyaknya di dunia ini. Allah SWT memerintahkan kita untuk merenungkan ciptaan-Nya. Kita harus merenungkan bagaimana Allah menciptakan kita, menciptakan langit, burni, tumbuhan, dan alam semesta berserta isinya. Bagaimana pula Allah mengurus segala urusan di alam semesta ini yang tak terhitung jumlahnya.\r\n\r\nNabi Muhammad pemah bersabda kewajiban seorang muslim adalah mencari ilmu. Oleh karena itu janganlah Kita hanya terpaku pada ilmu agama. \"llmu tanpa agama itu lumpuh, agama tanpa ilmu pengetahuan itu buta\". ltulah yang dikatakan Albert Enstein yang merupakan fisikawan terkenal. Oleh karena itu marilah kita pelajari Al-Quran. Ketika orang menganggap sains itu tidak sesuai Al-Quran maka sesungguhnya ada dua kemungkinan kesalahan yaitu, tidak bisa memahami Al-Quran atau salahnya hipotesis ilmiah. \r\n\r\nSumber: \r\n1. Buku Miracles Of Al-Qura\'an and As- Sunnah karya Dr Zakir Naik \r\n2. Keajaiban llmiah Bumi dan Luar Angkasa karya Yusuf Al Hajj Ahmad \r\n3. Al-Quran dan Sains karya Harun Yahya\r\n', 2),
(41, 'Demi Masa: Bagaimana Waktu Mengajari Kita', '1-telaah-utama', 'Siti Nurrohmah', 'Imam Bukhari meriwayatkan dalam sahih-nya di kitab Al-Riqoq (hamba sahaya) dari Ibnu Abbas, Rasulullah  bersabda:\r\n\r\nAda dua kenikmatan yang sering membuat manusia tertipu; kesehatan dan waktu luang.\r\n\r\nTentang kedudukan waktu, Allah  sendiri sangat menghargainya. Namun nyatanya kita masih saja cenderung melalaikan waktu dengan kegiatan yang tidak berguna. Jangankan waktu luang, setiap ada kesempatan, waktu bekerja pun kadang dimanfaatkan untuk memenuhi kepuasan nafsu saja. \r\n \r\nJika kenikmatan yang berupa kesehatan dan waktu luang tidak dimanfaatkan dengan baik, maka suatu saat nanti penyesalan yang mendalam akan muncul, dosa pun akan semakin menumpuk. Maka dari itu manfaatkan waktu yang ada sebaik-baiknya.\r\n \r\nHari-hari di saat sehat adalah harta yang sangat berharga. Waktu senggang juga menyimpan banyak manfaat. Selagi masih hidup, manfaatkanlah waktu-waktu tersebut dengan sebaik-baiknya karena waktu tidak akan pernah kembali.\r\n\r\nDi antara doa yang sering dilantunkan oleh Umar Ibnul Khathab mengenai waktu adalah, Ya Allah, saya memohon kepada-Mu saat-saat yang baik dan waktu-waktu yang penuh dengan keberkahan.\r\n \r\nSobat Hikam, tentu kita tahu jika umur manusia sangat pendek, maka kesempatan yang tersedia untuk melakukan kebajikan juga sangat sedikit.\r\n\r\nOrang yang beruntung adalah orang yang selalu menggunakan kesempatan yang ada dengan baik dan tidak membuatkannya terlewat begitu saja. Adapun orang-orang yang lalai, mereka tidak akan pernah memedulikan kerugian yang nanti akan dirasakan.\r\n \r\nKesempatan dan waktu adalah modal usaha yang sangat berharga. Diriwayatkan oleh Abu Hurairah, bahwa Rasulllah  bersabda: Allah benci terhadap setiap perkataan kasar, keji, dan sombong. Berteriak-teriak di pasar, menjadi mayat pada malam hari dan keledai di siang hari. Serta orang yang mengetahui urusan dunia namun bodoh akan urusan akhirat (H.R. Ibnu Hibban dengan sanad yang sahih)\r\n\r\nHadis ini mengisyaratkan kebencian dan kemurkaan Allah  kepada golongan manusia yang tidak menjaga dan memanfaatkan waktunya. Bergulirnya siang dan malam pun tidak terasa olehnya.\r\n \r\nNah, jadi hendaknya kita selalu menjaga dan menghargai waktu seperti hadis di atas. Jangan sampai nanti menyesalinya karena tidak bisa memanfaatkan waktu dengan baik.\r\n \r\nDari Mu\'adz bin Jabal, bahwa Rasulullah  bersabda, tidak ada yang membuat penghuni surga menyesal selain berlalunya beberapa saat tanpa diisi dengan zikir kepada Allah azza wa jalla. (HR ath-Thabrani dan lainnya, dan disahihkan oleh Al-bani)\r\n\r\nBila penyesalan yang demikian itu muncul dari penghuni surga yang masuk surga karena rahmat Allah  serta amal baik dan investasi waktu mereka, maka bagaimanakah penyesalan yang akan timbul dari orang yang sebaliknya. Maka dari itu, sebaiknya kita selalu menjaga dan memanfaatkan waktu.\r\n \r\nBerikut beberapa hal yang dapat membantu kita dalam menjaga waktu.\r\n \r\nYang pertama adalah merasa diri selalu diawasi Allah  (Muraqabah) dan takut kepada-Nya, hal ini dapat menolong kita untuk selalu memanfaatkan waktu karena adanya rasa takut dan selalu diawasi.\r\n\r\nYang kedua yaitu pengetahuan mengenai waktu-waktu dan tempat-tempat yang utama serta pemanfaatannya. Sebagai contoh, Allah  mengutamakan berbagai waktu, seperti bulan Ramadhan, tanggal 10 Zulhijjah, hari Jumat, sepertiga malam dan waktu lainnya seperti pada pagi hari. Allah  juga mengutamakan berbagai tempat, seperti Masjidil Haram di Mekah, Masjid Nabawi di Madinah, dan Masjidil Aqsa. Sebab pada saat-saat itu kebaikan berlipat ganda pahalanya.\r\n\r\nSelanjutnya hal yang dapat membantu kita menjaga waktu adalah kesadaran terhadap kewajiban dan peran dalam masyarakat sehingga mempunyai tanggung jawab dan tidak akan membuang waktunya dengan sia-sia.\r\n\r\nYang terakhir yaitu memilih teman yang saleh, karena ia akan menjadi sebaik-baik penolong dalam memanfaatkan waktu. \r\n\r\nSebelum terlambat, marilah kita memanfaatkan waktu yang tersisa dari umur kita untuk hal-hal yang bermanfaat, jangan menyia-nyiakan kesempatan hidup yang sekali ini hanya untuk melakukan sesuatu yang tidak berarti, karena waktu yang telah lewat tidak akan pernah bisa kembali lagi.\r\n\r\nSumber:\r\n1.	al-Audah, Sulaiman bin Hamd. 2003. Bagaimana Muslimah Memanfaatkan Waktu. Terjemahan oleh Ali Nurdin. Jakarta: Gema Insani Press.\r\n2.	Khalif, Khalid Abdul Mu\'thi. 2005. Nasihat untuk Orang-Orang Lalai. Terjemahan oleh Abdul Hayyie al-Kattani dan Arif Chasanul-Muna. Jakarta: Gema Insani Press.\r\n', 3),
(42, 'Urgensi Salat Dalam Islam', '1-telaah-utama', 'Khusnia Fera & Fadriatul Khoiriyah', 'Dari Ibnu Umar r.huma, ia berkata, Rasulullah  bersabda, \r\n\r\n\"Agama Islam dibangun atas lima perkara: Bersaksi bahwa tiada Tuhan selain Allah dan Muhammad adalah hamba dan utusan Allah, mendirikan shalat, membayar zakat, haji, dan shaum pada bulan Ramadhan. \" (Muttafaq \'alaih) \r\n\r\nSesuai dengan hadist tersebut, agama Islam diibaratkan sebuah bangunan dengan lima tiang. Kelima tiang itu sangatlah penting dalam agama terutama urusan salat yang menjadi urutan kedua setelah syahadat. Komitmen seorang hamba terhadap agamanya sangat ditentukan oleh kenyataan apakah dia salat atau tidak. \r\n\r\nRasulullah  bersabda, \r\nOrang yang tidak menjaga amanat tidak beriman; Orang yang salat tanpa bersuci terlebih dahulu, salatnya tidak sah; Orang yang tidak salat tidaklah beragama. Kedudukan salat dalam agama bagaikan kepala dengan jasad. (H.R. Thabrani)\r\n\r\nSalat laksana kepala pada badan. Begitu penting dan urgen kedudukannya dalam Islam. Namun kebanyakan dari kita tidak menyadari keutamaan dan hikmah dari ibadah wajib satu ini. Sebelumnya mari kita selisik terlebih dahulu definisi salat itu sendiri. \r\nSalat berasal dari bahasa arab: As Shalah, salat secara bahasa berarti doa. Sesuai dengan firman Allah ,\r\n\"Dan salatlah (berdoalah) untuk mereka\" (Q.s: At-Taubah 53) \r\n\r\nSedangkan secara terminologi salat berarti suatu ibadah yang terdiri atas ucapan ucapan (takbir, ayat ayatAl Quran, tasbih dan sebagainya) serta perbuatan tertentu yang diawali dengan takbiratul ihram dan diakhiri dengan salam. \r\n\r\nSetelah memahami makna kata salat, berikut ini adalah beberapa alasan mengapa salat begitu urgen dalam Islam. \r\n\r\nSalat menjadi salah satu bentuk wujud penyembahan kita kepada Rabb, yang merupakan tujuan manusia dan jin diciptakan di dunia, \r\n\"Dan tidaklah Aku menciptakan jin dan manusia, melainkan supaya mereka menyembah-Ku\". (Q.S: Adz Dzariyat [51]:56). \r\n\r\nBisa dikatakan, salat adalah ibadah yang istimewa daripada ibadah lainnya dalam rukun Islam. Kewajiban zakat akan gugur bagi seseorang yang tidak mampu atau tidak memiliki sejumlah harta yang ditetapkan. Ibadah puasa hanya diwajibkan bagi yang sanggup melakukannya dan akan gugur bagi yang sedang sakit, atau dalam keadaan safar / bepergian. Begitu pula dengan haji yang akan gugur kewajibannya bagi orang orang yang tidak mampu baik secara finansial, transportasi ataupun fisik. Namun lain halnya dalam salat, setiap orang wajib melaksanakan salat dan tidak dapat gugur karena alasan apapun bahkan dalam keadaan perang sekalipun. Hanya saja, pelaksanaannya dapat diringankan seperti keringanan untuk salat dengan sikap duduk bagi orang yang tidak mampu berdiri, atau salat dengan berbaring bagi yang tidak mampu duduk namun tetap saja tidak sampai menghapus kewaijban salat secara keseluruhan. \r\n\r\nDi dalam salat terhimpun hampir semua rukun Islam. Pada tasyahud awal dan akhir, terdapat dua kalimat syahadat yakni pada bacaan tasyahud. Dalam salat terkandung pula unsur zakat. Jika zakat disebut untuk membersihkan harta, maka salat adalah ibadah untuk membersihkan waktu sebab waktu juga termasuk harta yang berharga yang dalam pelaksanaan zakat pun memerlukan waktu serta untuk membersihkan diri dari kekumuhan dosa. \r\n\r\nSelanjutnya, dalam salat ada puasa karena ketika salat anggota badan berpuasa dengan menahan diri dari bergerak-gerak di luar gerakan salat, berbicara yang tidak perlu dan segala bentuk pelanggaran yang dapat membatalkan salat lainnnya. Dalam salat ada haji, yakni ketika mengerjakan salat kita diwajibkan menghadap ke Masjidil Haram.\r\n\r\nKarena kemuliaan ibadah yang satu ini, tidaklah mengherankan jika menjelang wafatnya, Rasulullah  berpesan, \r\n\"Jagalah salat... jagalah salat... \" (H.R. Ahmad) \r\n\r\nPerintah ibadah salat diperintahkan langsung dari Allah  pada peristiwa isra\' dan mi\'raj Rasulullah  adapun ibadah yang lainnya disampaikan melalui perantara Jibril. Di samping itu, salat menjadi ibadah bagi setiap makhluk. Dalam kamus Lisan al \'Arab, dikemukakan bahwa salat dari Allah  berarti rahmat, sedangkan salat yang dilakukan para makhluk, termasuk manusia, jin, dan malaikat adalah ibadah seorang hamba kepada Allah  dalam wujud berdiri, ruku\', sujud, yang disertai doa dan tasbih. Adapun salat dari bangsa binatang merupakan tasbih kepada Nya. \r\n\r\nSalat sebagai ibadah sepanjang masa juga menjadi barometer kebaikan seseorang. Ibadah ini merupakan sarana untuk mendidik jiwa, melatih sikap disiplin dan rendah hati. Sama halnya seperti cermin yang memperlihatkan wujud diri, salat juga memperlihatkan kepribadian kita. \r\n\r\nDengan demikian, salat adalah ibadah yang agung dan ancaman besar bagi siapapun yang meninggalkannya. Semoga sederet keutamaan dan urgensi salat yang begitu tinggi dalam Islam tersebut, menjadikan kita untuk tidak pernah meremehkan salat, serta memotivasi untuk semakin giat melaksanakan salat dan istiqomah memperbaikinya. WallahuA \'lam.\r\n\r\nSumber: \r\n1.	Ath-Thayyar, Abdullah. 2006. Ensiklopedia Shalat. Diterjemahkan oleh: A.M. Halim. Jakarta: Maghfirah Pustaka. \r\n2.	Nashr, Abdul Karim Muhammad. 2007. Shalat Penuh Makna. Diterjemahkan oleh: Imtihan Syafi\'i. Surakarta: Al Qowam. \r\n3.	Zakariyya, Muhammad. 2007. Hayya \'alash-shalah Meraih Keberkahan Rezeki Melalui Shalat. Diterjemahkan oleh: Andi Abdurrahman Ahmad. Yogyakarta: Citra Media.', 4),
(43, 'Raja Pengelana, Bersemi Selamanya', '10-puisi', 'Aldi Hendrawan', 'Bintang yang bersinar diantara kita \r\nMengepakkan sayap-Nya dan mulai terbang \r\nMembawa sepenggal kata dari sana \r\nEntah kemana aku tak tahu \r\nDan entah mengapa aku penasaran \r\n\r\nMemori yang hilang terbawa angin \r\nHanya berhembus dan tak kembali \r\nMenyisakan pecahan yang mulai membeku \r\nDi celah sempit, gelap, dan berdebu \r\n\r\nHitunglah dengan jari-Mu \r\nHari-hariku tanpa diri-Mu \r\nAku tahu sampai puluhan ribu \r\nDan saat Kau sudah selesai menghitungnya \r\nAku akan ada disana \r\nUntuk hidup bersama-Mu selamanya \r\n\r\nCintaku untuk sang bintang \r\nThe Holy Quran ', 2),
(44, 'Hijabmu Perhisasanmu', '9-keakhwatan', 'Melati Hasna N.', 'Apa kabar Sobat Hikam? Apakah sampai hari ini masih belum mengenakan hijab?\r\n\r\nPerlu diketahui bahwa ada orang yang mengenakan pakaian tetapi disebut telanjang, maksudnya pakaian yang berfungsi sebagai penutup tubuh itu tidak berfungsi seperti seharusnya entah karena tipis atau pendeknya pakaian. Akibatnya, tampaklah apa yang semestinya tidak boleh tampak, sebagaimana kebanyakan pakaian wanita masa kini. Telah dijelaskan dalam surah Al-Ahzab: 59, yang artinya \r\n\r\n...Katakanlah kepada istri-istrimu, anak-anak perempuanmu, dan istri-istri orang mukmin, Hendaklah mereka menutupkan jilbabnya ke seluruh tubuh mereka. Yang demikian itu agar mereka lebih mudah untuk dikenali, sehingga mereka tidak diganggu...\r\n\r\nDari ayat tersebut, sudah sangat jelas bahwa setiap wanita muslim dituntut mengenakan jilbab dan menutup auratnya tanpa ada pengecualian sama sekali.\r\n\r\nBerikut beberapa syarat mengenai mengenakan hijab:\r\n1.	Hijab itu harus menutupi seluruh badan kecuali wajah dua telapak tangan.\r\n2.	Hijab itu bukan dimaksudkan sebagai hiasan bagi dirinya, sehingga tidak diperbolehkan memakai kain yang berwarna mencolok, atau kain yang penuh gambar dan hiasan.\r\n3.	Hijab itu harus lapang dan tidak sempit sehingga tidak menggambarkan postur tubuhnya.\r\n4.	Hijab itu tidak memperlihatkan sedikitpun bagi kaki wanita.\r\n5.	Hijab yang dikenakan tidak sobek sehingga tidak menampakkan bagian tubuh atau perhiasan wanita.\r\n\r\nNah, sekarang kita sudah mengetahui bahwa mengenakan hijab dan menutup aurat itu hukumnya wajib. \r\n\r\nSobat Hikam, kita harus mulai berlatih menutup aurat kemanapun kita pergi, dan mengenakan hijab sesuai dengan seharusnya ya. Sekian dulu keakhwatan kali ini, semoga bisa bermanfaat ya Sobat Hikam!\r\n\r\nSumber:\r\n1.	Sa\'dawi, Amru Abdul Karim. 2009.Wanita dalam Fikih Al-Qaradhawi. Terjemahan oleh Muhyiddin Mas Rida. Jakarta: Pustaka Al-Kautsar.\r\n2.	Uwaidah, Syaikh Kamil Muhammad. 2007. Fiqih Wanita. Terjemahan oleh M. AbdulGhoffar. Jakarta: Pustaka Al-Kautsar.', 3),
(45, 'Rasulullah Di Mata Dunia', '4-info-lepas', 'Zakiyatul Fakhiroh', 'Rasulullah  selalu disanjungkan oleh semua umat muslim di seluruh dunia. Bahkan rasulullah pun juga dipuji oleh umat umat non muslim yang notabene adalah seorang ilmuwan hebat di negaranya. Beberapa pendapat tentang Rasulullah : \r\n\r\n1.	Michael H. Hart\r\nMichael H. Hart, dalam bukunya \"Most Influention Person in History\" (Seratus Orang yang Berpengaruh dalam Sejarah) menempatkan Rasilullah  pada urutan pertama di daftar itu. Dia mengatakan, \"Pilihan saya Muhammad menjadi orang pertama yang terpenting dan teragung sebagai tokoh sejarah telah mengagetkan para pembaca. Namun, dia (Muhammad) adalah satu-satunya tokoh dalam semua sejarah yang sukses dengan kesuksesan sangat tinggi pada tingkat agama dan dunia. Ada banyak rasul, nabi dan para pemimpin yang memulai dengan misi-misi agung. Namun, mereka meninggal tanpa penyempumaan misi-misi tersebut, seperti Isa di Kristen, atau yang lain telah mendahului mereka, seperti Musa di Yahudi. Namun Muhammad  adalah satu-satunya (Rasul) yang menyempurnakan misi agamanya, menetapkan hukum-hukumnya dan diimani oleh bangsa-bangsa selama hidupnya.\r\n\r\nKarena dia mendirikan negara baru di sisi agama. Sedang di bidang dunia dia juga menyatukan kabilah-kabilah di dalam bangsa, menyatukan bangsa-bangsa di dalam umat, meletakan buat mereka semua asas kehidupannya, menggariskan masalah-masalah dunianya, meletakannya pada titik tolak menuju dunia. Dan juga di dalam hidupnya, dia adalah (Rasul) yang memulai risalah agama serta dunia dan menyempumakannya.\" \r\n\r\n2.	Bretly Hiler\r\nSeorang Orientalis Jerman, Bretly Hiler, di dalam bukunya \"Orang-Orang Timur dan Keyakinan-keyakinan Mereka\" mengatakan, \"Muhammad adalah seorang kepala negara dan punya perhatian besar pada kehidupan rakyat dan kebebasannya. \r\n\r\nDia menghukum orang-orang yang melakukan pidana sesuai dengan kondisi zamannya dan sesuai dengan situasi kelompok-kelompok buas di mana Nabi hidup di antara mereka. Nabi ini adalah seorang penyeru kepada agama Tuhan Yang Esa.\r\n\r\nDi dalam dakwahnya, dia menggunakan cara yang lembut dan santun meskipun dengan musuh-musuhnya. Pada kepribadiaannya ada dua sifat yang paling utama dimiliki oleh jiwa manusia. Keduanya adalah \"keadilan dan kasih sayang\".\r\n\r\n3.	Mahatma Gandhi\r\nMahatma Gandhi (Komentar mengenai karakter Muhammad  di Young India, 1924) \"Pemah saya bertanya-tanya siapakah tokoh yang paling penting manusia? Saya lebih dari yakin tidak pedanglah yang memberikan kebesaran pada Islam pada masanya. Tetapi dia datang dari kesederhanaan, kebeisahajaan, kehati-hatian Muhammad, juga pengabdian luar biasa untuk teman dan pengikutnya, tekadnya, keberaniannya, serta keyakinannya pada Tuhan dan tugasnya. Semua ini (dan bukan pedang) Semua halangan. Ketika saya menutup halaman terakhir volume 2 (biografi Muhammad), saya sedih karena tiada lagi cerita yang tersisa dari kehidupan yang agung. Terbukti, bukan hanya umat Islam saja yang menganggap bahwa Nabi Muhammad  tidak hanya sebagai Messenger of God (Allah SAW), dan sebagai panutan/teladan kepada seluruh umat manusia. Bahkan non-muslim sendiri secara sadar mengagumi kepribadian Nabi Muhammad . Tidak hanya Hart, Hitler dan Mahatma Ghandi saja, diluar sana masih banyak non-muslim yang mau membuka diri kemudian jujur mengatakan bahwa sosok Nabi Muhammad  adalah manusia luar biasa dengan akhlak yang mengagumkan \r\n\r\nBagaimana dengan kita? Apakah kita sudah mengagumi sosok Nabi Muhammad sebagai panutan kita? Apakah kita sudah menjalankan sunnah-sunnahnya? \r\n\r\nSumber: \r\nKhan, Abdul Walid. 2001. Rasulullah di Mata Sarjana Barat. Yogyakarta: Mitra Pustaka.', 2),
(46, 'Blood, Sweat, and Tears', '5-cerbung', 'Nabila Rudyas Safura', 'Andai saja, andai aku tidak menjadi egois. Andai aku tidak terus menyalahkannya. Andai aku tak merebut bola itu darinya. Andai aku tak mendorongnya. Andai aku mempercayainya. Andai aku memberikannya kesempatan untuk melakukan shoot itu. Andai saja. Semuanya tak akan seperti ini. Salahkan egoku!\r\n\r\n~*~\r\n\r\nKalau begitu permisi, aku membungkuk, kemudian beranjak keluar kantor. Seperti yang ku duga, White mulai menghujaniku dengan berbagai ocehan. Bisakah kau diam? Aku sedang tak ada gairah untuk membicarakan masalah ini. Memang tak seharusnya dibicarakan dengannya. Aku memang tak tahu pasti tentang masalahmu dengan Rocky atau siapalah itu. Kau juga tak pernah bercerita. Tapi guru tadi bilang apa yang terjadi bukan salahmu kan? Jadi kenapa kau langsung menolak tawaran besar itu dengan bersikukuh terhadap hal yang tak jelas? Cobalah pikirkan lagi, aku tahu kau menginginkannya kan? Hatimu tak bisa berbohong. Jangan buat dirimu menyesal! Aku hanya ingin membantumu kembali ke jalan yang benar-benar kau inginkan.\r\n \r\nKuhentikan langkahku kemudian mentapnya tajam. Aku tak butuh bantuanmu. Sudah cukup dengan yang kumiliki sekarang. Aku sudah melepaskannya. Aku sudah bertahan lebih dari setahun untuk menjauhi basket karena rasa bersalah yang terus menghantuiku. Namun, itu mulai mereda belakangan ini. Aku sudah mulai terbiasa dengan kanvas dan kuasku. Tapi kenapa? Kenapa kau harus muncul dan membuatku terjun ke lapangan itu lagi hah?! Kau bahkan tak tahu apa-apa.\r\n \r\nAku mengambil napas lalu membuang muka. Emosiku melonjak, Pergilah! lagipula ini bukan tempatmu. Hantu atau arwah sepertimu tak seharusnya berada di antara manusia dan ikut campur dengan urusanmereka. Tanpa menunggu jawaban, aku segera beranjak meninggalkannya yang masih mematung di tempat. \"Baiklah! Terserah padamu. Bagaimanapun, Allah akan menempatkan hambanya di jalan yang paling tepat untuknya. Dan mungkin basket bukan jalanmu. Kau sendiri yang merasakannya. Aku akan mendukung apapun keputusanmu sekarang. Jadi, kuharap kau menarik kata-kata kejammu tadi padaku.\" Ucapan White tak berhasil menghentikan langkahku. Aku tetap berlalu pergi. Memunggungi gadis aneh yang ternyata tak pernah ku lihat lagi wajahnya setelah itu.\r\n\r\n~*~\r\n\r\nWaktu terus bergulir, hari-hari berganti, musim pun turut berubah. Dan aku? Haha. Aku masihlah Dean yang sama. Ya, setelah gadis itu benar-benar menghilang. Ia lenyap, seperti ditelan bumi. Aku sudah mencoba mencarinya, karena rasa bersalahku. Meski mungkin hantu tidak punya perasaan semacam sakit hati atau apalah itu. Tapi setidaknya, dengan perginya gadis yang kusebut White itu menghilang, kehidupanku kembali berjalan normal. Menjadi Dean yang biasanya. Dean yang duduk di bangku penonton lapangan basket dengat kanvas dan kuas menemaniku. Banyak orang memandangku lari dari kenyataan. Banyak orang mengecapku \'mantan kapten basket pengecut\' yang menjadikan melukis sebagai pelarianku. Mereka adalah orang-orang yang tidak mengerti aku.\r\n\r\nAsal kau tahu, kadang, mimpi yang ingin kau gapai tidak berjalan seperti keinginanmu. Ketika kau hampir menggapainya, tetapi banyak hal yang menghalangimu. Saat itu, berpikirlah kembali. Apakah mimpi itu benar-benar hal yang paling tepat untukmu atau tidak.\r\n \r\nDan aku, katakan saja ini hanyalah alasan. Ya, awalnya aku memang lari dari basket dan memilih untuk melukis sebagai pelarian. Namun, selama ku jalani aku mulai sadar. Aku menikmatinya. Melukis. Tidak seperti basket yang membuatku menuntut diri sendiri hanya untuk berusaha memenangkan pertandingan. Jujur saja, sesungguhnya aku tidak benar-benar menaruh hatiku padanya. Mungkin, hanya sebuah obsesi?\r\n \r\nSedangkan melukis, aku merasa jatuh cinta. Pada lukisanku? Haha tidak. Pada objek yang akan kutuangkan. Melukis membuatku tenang dan bahagia hanya dengan menatapnya. Eiy, jangan berpikir bahwa aku mengatakan ini hanya untuk mengelak basket. Ini sungguhan. Aku memilih untuk melukis bukan berarti aku menyerah pada mimpiku terhadap basket. Aku hanya berjalan di lajur yang sedikit berbeda dari mimpi awalku. Sekarang aku melukis, melukis mereka yang ada di lapangan sana. Ini sungguh lebih menyenangkan.\r\n \r\nAku tidak peduli orang berpikir apa tentangku. Lagipula, apa yang kupilih sekarang juga bukanlah sesuatu yang kujalani begitu saja. Jalan yang ku lalui sekarang ini adalah jalan yang kudapat setelah melalui banyak hal. Kita mengejar mimpi tidak semudah yang orang lihat. Itu bahkan bisa menguras darah, keringat, dan air mata.\r\n \r\nAh iya, ini membuatku teringat pada ucapan White terakhir kali. Bahwa Allah akan menempatkan hambanya di jalan yang paling tepat untuknya. Jadi, apapun pandangan orang lain terhadapku, aku yakin. Sangat. Kalau apa yang kulakukakan sekarang adalah jalan terbaik yang Allah pilihkan untukku. Untuk Dean.\r\n\r\n \"Wah, lukisannya bagus.\" Suara tak asing yang tiba-tiba muncul membuyarkan konsentrasiku. Aku menoleh. Seorang gadis yang entah dari mana sudah duduk di sebelahku seraya memandangi lukisanku intens. Eh tunggu. Bukankan ini seperti, dejavu? Aku menggelengkan kepala mencoba mengembalikan fokusku.\r\n \r\nGadis itu, aku memandanginya dari ujung rambut sampai ujung kaki, seperti dulu. Ia mengenakan seragam yang sama denganku, terlihat rapi dan masih baru. Sepatunya juga masih mengkilap. Aku memandang wajahnya. Kini sorotan matanya yang berbinar beralih dan bertemu dengan tatapan mataku. Kemudian senyumnya mulai mengembang. Senyum yang tak pernah aku lupakan bahkan ketika ia nampak sedikit berbeda kali ini. Dengan balutan hijab yang menghiasi mahkotanya. \"White?\r\n\r\n-Tamat-', 1),
(47, 'Persyariatan Wudu', '4-info-lepas', 'Dany Nurcahyo', 'Sobat Hikam, sebelum salat, kita diwajibkan untuk berwudu. Menurut Wahbah Al-Zulaihi pengertian wudu adalah mempergunakan air pada anggota tubuh tertentu dengan maksud untuk membersihkan dan menyucikan. Adapun menurut syara, wudu adalah membersihkan anggota tubuh tertentu melalui suatu rangkaian aktivitas yang dimulai dengan niat, membasuh wajah, kedua tangan dan kaki serta menyapu kepala. Persyariatan wudu berititik pijak pada dua dalil.\r\n \r\nKewajiban berwudu didasarkan pada Al Quran Al Karim.\r\n                                                            \r\n\"Hai orang-orang yang beriman, apabila kamu hendak mengerjakan salat, maka basuhlah mukamu dan tanganmu sampai dengan siku, dan sapulah kepalamu dan (basuh) kakimu sampai dengan kedua mata kaki, dan jika kamu junub maka mandilah, dan jika kamu sakit atau dalam perjalanan atau kembali dari tempat buang air (kakus) atau menyentuh perempuan, lalu kamu tidak memperoleh air, maka bertayammumlah dengan tanah yang baik (bersih), sapulah mukamu dan tanganmu dengan tanah itu. Allah tidak hendak menyulitkan kamu, tetapi Dia hendak membersihkan kamu dan menyempurnakan nikmat-Nya bagimu, supaya kamu bersyukur. (QS. Al-Maidah: 6)\r\n \r\nDalam hadis yang diriwayatkan dari Ibnu Umar, Rasulullah SAW bersabda yang artinya, Allah tidak akan menerima salat tanpa bersuci dan tidak pula sedekah dari hasil menipu.\r\n \r\nHadis yang diriwayatkan dari Abu Said R.A., Rasulullah SAW bersabda yang artinya, Kuncinya salat adalah suci (dari hadas kecil dan besar), haramnya (larangan melakukan larangan-larangan dalam salat) adalah dimulai dari takbir, dan halalnya (boleh melakukan larangan-larangan dalam salat) adalah setelah salam.\r\n \r\nBerwudu merupakan syarat sah solat sehingga jika mengerjakan suatu salat tetapi tidak berwudu terlebih dahulu maka salat yang dikerjakan akan sia-sia atau mubah atau tidak sah. Berikut beberapa hal yang perlu diperhatikan saat berwudu.\r\n\r\n1.	Niat\r\nNiat adalah maksud hati terhadap sesuatu yang disertai dengan pelaksanaannya. Adapun niat wudhu adalah suatu ketetapan hati untuk melakukan wudhu sebagai pelaksanaan dari perintah Allah.\r\n\r\n2. Membasuh kedua tangan sampai siku\r\n         \r\nApabila kamu hendak mengerjakan shalat, maka basuhlah mukamu dan tanganmu sampai dengan siku. (Q.S. Al-Maidah [5] : 6)\r\n\r\nTangan adalah organ tubuh antara ujung jari sampai siku. Sedangkan siku adalah sendi yang terletak antara pangkal lengan dengan pergelangan tangan. Oleh sebab itu, membasuh dua siku menjadi wajib.\r\n\r\n3. Menyapu Kepala\r\nMenyapu kepala termasuk telinga sebagai rukun wudhu, didasarkan atas Firman Allah dalam Surah Al-Maidah ayat 6.\r\n\r\n4.	Membasuh Kedua Kaki Sampai Mata Kaki\r\nDua mata kaki adalah dua tulang yang menonjol di samping. Tepatnya di persendian batis dengan telapak kaki. Membasuh kaki adalah wajib sesuai dengan kesepakatan umat berdasarkan nash Al-Quran dan hadis.\r\n\r\n5. Terus Menerus (Muawaalat)\r\nMaksudnya melakukan kayfiat wudu dalam satu waktu tanpa terpisah oleh waktu atau kegiatan lain.\r\n\r\n6. Tertib\r\nBerturut-turut artinya mendahulukan mana yang harus didahulukan dan mengakhiri mana yang harus terakhir.\r\n\r\nSumber:\r\nBuku Mukjizat Berwudhu karya Oan Hasanuddin.\r\n\r\nBarang siapa yang berwudhu dan memabaguskan wudunya, maka akan keluarlah dosa-dosa dari badannya sampai-sampai ia akan keluar dari bawah kuku-kukunya. (H.R. Muslim dalam Kitab at-Thahatah)', 1),
(48, 'LDKI Latih Kepemimpinan, Komunikasi, dan Bentuk Karakter Islami', '13-kki-kita', 'Nilam Mustika Rani', 'KKI Smansa, (2829 November 2017) adakan LDKI sebagai salah satu program kerja tahunan. Sebanyak 73 peserta dari kelas X dan XI mengikuti rangkaian kegiatan mulai dari latihan kepemimpinan, pelatihan komikasi lisan dan tulis, hingga materi keorganisasian. Bertempat di ruang serbaguna, LDKI ditutup dengan reorganisasi pengurus KKI, buletin Al Hikam dan rebana Khusuful Qomar.\r\n \r\nPerhatian sekolah untuk kegiatan LDKI sangat besar. Buktinya, Kepala SMAN 1 Wonosobo hadir dan berkenan membuka acara, di samping kehadiran para pembina dan pendamping kegiatan. Pada kegiatan yang berlangsung dua hari satu malam peserta mendapat materi tidak hanya dari narasumber dalam, hadir pula narsumber dari luar sekolah antara lain Tri Handoyo, guru SMAN 1 Sapuran, alumni Smansa tahun 2008 dan Arif Budi alumni Smansa tahun 2009.\r\n\r\nKegiatan LDKI terdiri atas beberapa rangkaian acara, diantaranya adalah materi keislaman oleh Bapak Aziz Safarudin serta organisasi dan pengkaderan oleh Bapak Ghufron Effendy.  Berikutnya peserta diajak berlatih berbicara di depan umum dengan percaya diri pada sesi public speaking. Di samping itu ada juga materi sekaligus pelatihan menulis yang disampaikan oleh Bapak Eko Gunawan. Beberapa game juga diadakan, salah satunya yaitu ta\'aruf berantai yang bertujuan meningkatkan ukhuwah dan keakraban antar peserta.\r\n \r\nKegiatan yang mengangkat tema \'Eksplor Potensi Diri Membangun Karakter Islami\' ini, diharapkan mampu melatih peserta menjadi sosok pemimpin yang berkarakter islami sekaligus menyiapkan generasi KKI baru untuk KKI yang lebih maju.\r\n\r\nEksplor Potensi Diri, Membangun Karakter Islami', 1),
